import React from 'react';
import {observer} from "mobx-react-lite";

const Brands = observer(({brands}) => {
    return (
        <div>
            {brands.map((item) => {
                console.log(item.name)
                return (
                    <div key={item.id}>
                        <img src={item.img} />
                        <p>{item.name}</p>
                        <p>Price: {item.price}</p>
                        <p>Rating: {item.rating}</p>
                    </div>
                )
            })}
        </div>
    );
});

export default Brands;
